import React, { useState } from 'react';
import './Profile.css';

const Profile = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <div className="profile-page">
      <nav className="navbar">
        <h1>Health&Me</h1>
      </nav>

      <div className="profile-container">
        <div className="profile-pic-container">
          <img 
            src={require('../assets/p.jpg').default} 
            alt="Profile" 
            onError={(e) => { e.target.src = 'https://via.placeholder.com/150'; }}
          />
        </div>

        <div className={`sidebar ${menuOpen ? 'open' : ''}`}>
          <div className="toggle-btn" onClick={toggleMenu}>
            {menuOpen ? '←' : '→'}
          </div>
          <ul className="menu-list">
            <li>Your Profile</li>
            <li>My Programs</li>
            <li>My Diet Plans</li>
            <li>My Articles</li>
            <li>My Medical History</li>
            <li>My Progress</li>
            <li>My Trainer</li>
            <li>My Subscription</li>
          </ul>
        </div>

        <div className="content">
          <h2>My Programs</h2>
          <div className="programs-images">
            <img src={require('../assets/v1.jpg').default} alt="Program 1" />
            <img src={require('../assets/v2.jpg').default} alt="Program 2" />
            <img src={require('../assets/v3.jpg').default} alt="Program 3" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
